    return (
        <nav>
            <h1>Recipe App</h1>
            <ul>
                <li>
                    <NavLink to="/add-recipe">Add Recipe</NavLink>
                </li>

                <li>
                    <NavLink to="/">Home</NavLink>
                </li>
            </ul>
        </nav>
    );
}

export default Header;
